  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a study done on
  Kenai National Wildlife Refuge to determine which habitats moose prefer to calve
  in. The majority of observations of female moose,(Alces alces) with recently-born
  calves have been in open, bog-meadow, black spruce, (Picea mariana), habitats on
  the Kenai National Moose Range, but many moose probably calve in other areas where
  they are more difficult to observe. Frequent aerial surveys over the Moose-Chickaloon
  River Area during the calving period from 1957 to 1970 revealed maximum numbers
  of observed cows in the calving area in 1964, or 17 years after a major wildfire
  burned through the area. Numbers of observed cows declined after several years of
  antlerless seasons and several severe winters but increased again after antlerless
  seasons were suspended and winters moderated. Numbers of observed calves paralleled
  numbers of observed cows. Maximum twinning rates declined from a high of 46 percent
  in 1962 to 7 percent in 1966 but increased to 48 percent in 1969. Twinning rates
  appeared related to forage conditions, mild winters and moose density. General observations
  and observed numbers of calves suggest two birth peaks may have occurred in the
  1960's, one in early June and another in early July. Population estimates suggest
  generally less than 20 percent of the refuge's moose population calve in the Moose-Chickaloon
  River Area.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
